import React from 'react';
import {BrowserRouter as Router, Route, } from 'react-router-dom'

import './App.css';
import Navbar from './components/layout/Navbar'
import Login from './components/auth/Login'


function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <Route path='/' component={Login} />

      </Router>
    </div>
  );
}

export default App;
